(2895, 278, 'mfn-page-items-seo', 'Heading\n\n<h2>Kontaktuj Nás</h2>\n\ncenter\n\nno-repeat;center top;;\n\nauto\n\n<img src=\"http://antflower.sk/wp-content/uploads/2014/11/contact-page-shop-image-1.png\" alt=\"contact-page-shop-image\"/>\n\nzoomInUp\n\nAddress\n\n<div style=\"margin-left: 5%;\">\r\n<h3>Adresa</h3>\r\n[divider height=\"10\"]\r\n<h5 style=\"margin-bottom: 7px;\">Ant Flower</h5>\r\n<p class=\"big\">Bratislavská cesta 5, 94901\r\n<br>\r\nNitra, Slovensko</p>\r\n</div>\r\n<div style=\'margin-left: 5%;\'>\r\n[divider height=\"10\"]\r\n<h3>Telefón</h3>\r\n<p class=\"big\">+421 (908) 555 946</p>\r\n</div>\r\n<div style=\'margin-left: 5%;\'>\r\n[divider height=\"10\"]\r\n<h3>E-mail</h3>\r\n<p class=\"big\">antflower@antflower.sk</p>\r\n</div>\r\n<div style=\'margin-left: 5%;\'>\r\n[divider height=\"10\"]\r\n<h3>Pracovný Čas</h3>\r\n<p class=\"big\">Pondelok-Nedeľa 08:00 - 21:00</p>\r\n</div>\n\nno-repeat;center top;;\n\nauto\n\nHr\n\n[divider height=\"30\"]\r\n<hr />\n\nno-repeat;center top;;\n\nauto\n\n<div style=\"margin-right: 7%;\">\r\n\r\n<h2>O Nás</h2>\r\n\r\n[divider height=\"40\"]\r\n\r\n<hr style=\"height: 3px; width: 40%; background-color: #adadaa; color: #adadaa; float: left;\" />\r\n\r\n[divider height=\"20\"]\r\n\r\n<h5>Kvetinárstvo Antflower pôsobí na trhu od roku 2002, nachádza v nákupnom centre Hypermarket Nitra.\r\n<br><br>\r\nOd roku 2006 sme priamym dovozcom rezaných a črepníkových kvetov priamo z Holandska. Kvety nakupujeme na najväčších burzách v Holandsku. Našim zákazníkom ponúkame čerstvosť a kvalitu na vysokej úrovni, pretože dodávataľmi sú priamo pestovatelia a výrobcovia kvetov v Holandsku. </h5>\r\n\r\n<h5>Zavolajte nám +421 (908) 555 946</h5>\r\n\r\n[divider height=\"40\"]\r\n\r\n[button title=\"Viac o nás\" link=\"http://antflower.sk/o-nas/\" color=\"theme\"]\r\n\r\n</div>\n\nno-repeat;center top;;\n\nauto\n\nContact form\n\n<h2>Objednať priamo</h2>\r\n[formidable id=9]\n\nno-repeat;center top;;\n\nauto\n\n48.3118401\n\n18.0677784\n\n15\n\n600\n\nROADMAP\n\nhttp://antflower.sk/wp-content/uploads/2014/11/icon-maps-1.png\n\n[\r\n　{\r\n　　\"stylers\": [\r\n　　　{ \"hue\": \"#ff8800\" },\r\n　　　{ \"saturation\": -77 },\r\n　　　{ \"lightness\": -12 }\r\n　　]\r\n　}\r\n]\n\nbox\n\n'),
